import React from 'react'

import './Calendar.css'

const Calendar = props => {

    if (props.calendar.length === 0){
        return (
            <div className="center"> 
            <h2>Here should be a calendar</h2>
            </div>
        )
    return (
        <h1>This item should be the calendar</h1>
    )
    }

}

export default Calendar
